import React from 'react';
import menuStyle from './Menu.module.scss';

class Menu extends React.Component {

render() {

    const {menu, menuState} = this.props;


    let menuLists = menu.map((menuList) =>
     <li key={menuList.id} className={menuStyle.menu__item}>
         <a href={menuList.url} className={menuStyle.menu_link}>{menuList.name}</a>
     </li>
    );
    return(<nav className={menuStyle['menu-wrap']}><ul className="d-flex">{menuLists}</ul></nav>)
    }
}

export default Menu;
